import React from 'react';
import './Dashboard.css';

const meals = {
  breakfast: [{ name: "Bread", kcal: 130 }, { name: "Egg", kcal: 155 }],
  lunch: [{ name: "Lettuce", kcal: 2 }, { name: "Tomato", kcal: 18 }],
  snacks: [{ name: "Apple", kcal: 52 }, { name: "Hummus", kcal: 230 }],
  dinner: [{ name: "Sweet potato", kcal: 86 }, { name: "Carrot", kcal: 40 }],
};

const Dashboard = () => {
  const totalKcal = Object.values(meals)
    .flat()
    .reduce((sum, item) => sum + item.kcal, 0);

  return (
    <div className="dashboard">
      <div className="summary-box">
        <h2>{totalKcal} kcal</h2>
        <div className="macros">
          <div className="bar carbs"></div>
          <div className="bar protein"></div>
          <div className="bar fat"></div>
        </div>
      </div>

      <div className="meal-sections">
        {Object.entries(meals).map(([mealType, items]) => (
          <div key={mealType} className="meal-block">
            <h3>{mealType.charAt(0).toUpperCase() + mealType.slice(1)}</h3>
            <ul>
              {items.map((item, i) => (
                <li key={i}>{item.name} - {item.kcal} kcal</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
